import logo from './logo.svg';
import './App.css';
import React, {useState} from 'react';
import EventButton from './Components'
import createTable from './backend'


function App() {
  const [count, setCount] = useState(0);
  return (
    <div className="App">
      <header className="App-header">
      <input name="myInput" />
        <EventButton onClick={()=>setCount(count+1)}>Update counter</EventButton>
        Count is {count}
        <EventButton onClick={()=>createTable()}>Connect and create test table</EventButton>
      </header>
    </div>
  );
}



export default App;
